import lgc from '../lgc.png';
import './Items.css';

fetch('./articles.json')
    .then((response) => response.json())
    .then((findresponse) => {
        console.log(findresponse.title)
        this.setState({
            data: findresponse.title,
        })
    })

const Items = (props) => {
    fetch('./articles.json')
    .then((response) => response.json())
    .then((findresponse) => {
        console.log(findresponse.title)
        this.setState({
            data: findresponse.title,
        })
    })
    return (
        <div className="Items">
            <div className="card">
                <img src={lgc} className="card-img-top" alt="..." />
                <div className="card-body">
                    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                </div>
            </div>
        </div>
    );
}

export default Items;
